import logo from './logo192.png';
function Header() {
    return(
      <header>
        <nav>
          <img src={logo} />
          <ul className="nav-items">
            <li><a href="#">Pricing</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Contact</a></li>
          </ul>
        </nav>
      </header>
    )
}

export default Header;
